var Book=function(o,t){this.name=o,this.author=t,this.bookID="id"+Math.random().toString(16).slice(2)},Books=function(){function o(){this.books=[]}return o.prototype.addBook=function(o){try{this.books.push(o)}catch(o){console.error(o)}},o.prototype.findBook=function(t){try{var o=this.books.find(function(o){return o.bookID===t});if(o)return o}catch(o){console.error(o)}},o}(),books=new Books;module.exports={Book:Book,Books:Books,books:books};